def generate_prime_square(n):
    """"""
    square = [[0] * n for _ in range(n)]
    for j in range(n):
        b = [0] * n
        b[j] = 1
        b[-j - 1] = 1
        if j != n - 1 and j != n // 2:
            square[j] = b
        elif n % 2 == 0:
            square[j] = b
        else:
            if j == n - 1:
                b[n // 2] = 1
                square[j] = b
            if j == n // 2:
                b[n // 2 - 1] = 1
                square[j] = b
    return square
